import {createBrowserRouter, 
  createRoutesFromElements,
  Route, 
  RouterProvider
} from 'react-router-dom'

// pages
import Home from './pages/Home'
import Players from './pages/Players'
import Signup from './pages/Signup'
import PlayerProfile, {PlayerProfileLoader} from './pages/PlayerProfile'
import Courts, {CourtsLoader} from './pages/Courts'
import CourtProfile, {CourtProfileLoader} from './pages/CourtProfile'
import Scheduler, {PlayersLoader} from './pages/Scheduler'

// layouts
import RootLayout from './layouts/RootLayout'

const router = createBrowserRouter(
  createRoutesFromElements(
    <Route path="/" element={<RootLayout />}>
      <Route index element={<Home />} />
      <Route 
        path="signup"
        element={<Signup />} 
        />
      <Route 
        path="players" 
        element={<Players />} 
        />
      <Route 
        path="courts" 
        element={<Courts />} 
        loader={CourtsLoader}
        />
      <Route 
        path="courts/:id" 
        element={<CourtProfile />}
        loader={CourtProfileLoader}
        />
      <Route 
        path="players/:id" 
        element={<PlayerProfile />}
        loader={PlayerProfileLoader}
        />
      <Route 
        path="scheduler" 
        element={<Scheduler />}
        loader={[CourtsLoader, PlayersLoader]}
        />
    </Route>

  )
)

function App() {
  return (
    <RouterProvider router={router} />
  );
}

export default App
